import React from 'react';
import ReactDOM from 'react-dom';
function Hello(props){

    return (
    <ol>
        {props.children.map((child,index)=><li key={index}>{child}</li>)
        }
    </ol>)
    
}
function Demo(){
        const arr = [
            <h1 key="1">hello</h1>,
            <h2 key="2">react</h2>
        ]
        return(
            <div>
                <Hello>
                   { arr}
                </Hello>
            </div>
        )
}
ReactDOM.render(
    <Demo />,
    document.getElementById('root')
  );
